pragma solidity 0.5.7;

import "./erc/ERC20.sol";
import "./interfaces/ViaOracle.sol";
import "./interfaces/ViaFactory.sol";
import "./interfaces/ViaCash.sol";
import "./interfaces/ViaBond.sol";
import "./interfaces/ViaToken.sol";
import "@openzeppelin/upgrades/contracts/Initializable.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/ownership/Ownable.sol";
import "./utilities/StringUtils.sol";
import "./utilities/PaymentUtils.sol";
import "./utilities/Pausable.sol";
import "./interfaces/ViaFees.sol";
import "./interfaces/VerifiedClient.sol";
import "./interfaces/VerifiedRates.sol";

contract Cash is ViaCash, ERC20, Initializable, Ownable, Pausable {

    using stringutils for *;
    using paymentutils for *;

    //via factory address
    ViaFactory private factory;

    VerifiedRates private rates;

    //via oracle
    ViaOracle private oracle;

    //name of Via cash token (eg, Via-USD)
    string public name;
    string public symbol;
    bytes32 public cashtokenName;

    struct deposit{
        bytes16 depositAmount;
        bytes16 issuedAmount;
        address depositor;
    }

    //mapping of buyers (address) to deposit currency (bytes32) to deposits 
    mapping(address => mapping(bytes32 => deposit)) public deposits;

    bytes32[] public currencies;

    //data structure holding details of currency conversion requests pending on oraclize
    struct conversion{
        address party;
        address counterparty;
        bytes32 operation;
        bytes32 paid_in_currency;
        bytes32 payout_currency;
        bytes16 amount;
        bytes16 EthXvalue;
        bytes16 ViaXvalue;
    }

    //queue of pending conversion requests with each pending request mapped to a request_id returned by oraclize
    mapping(bytes32 => conversion) private conversionQ;

    //events to capture and report to Via oracle
    event CashIssued(address indexed party, bytes32 currency, uint256 amount);
    event CashRedeemed(address indexed party, bytes32 currency, uint256 amount);
    event CashDeposits(address indexed party, bytes32 currency, uint256 amount);
    event CashTransfer(address indexed party, address indexed counterparty, bytes32 currency, uint256 amount);

    //mutex
    bool lock;

    //initiliaze proxies
    function initialize(bytes32 _name, bytes32 _currency, address _owner, address _oracle, address _token, address _fee) public initializer{
        Ownable.initialize(_owner);
        factory = ViaFactory(msg.sender);
        oracle = ViaOracle(_oracle);
        name = string(abi.encodePacked(_name));
        symbol = _name.substring(0,5);
        cashtokenName = _currency;
        lock = false;
        rates = VerifiedRates(_fee);
    }

    //handling pay in of ether for issue of via cash tokens
    function() external payable{
        //ether paid in
        require(msg.value !=0);
        //only to pay in ether
        require(msg.data.length==0);
        //contract must not be paused
        require(paused == false);
        //check aml status
        //require(amlCheck(msg.sender)==true);        
        //issue via cash tokens
        issue(ABDKMathQuad.fromUInt(msg.value), address(this), msg.sender, "ether");
    }

    //overriding this function of ERC20 standard for transfer of via cash tokens to other users or to this contract for redemption
    function transferFrom(address sender, address receiver, uint256 tokens) external returns (bool){
        //contract must not be paused
        require(paused == false);
        //check aml status
        //require(amlCheck(sender)==true);
        //require(amlCheck(receiver)==true);
        //ensure sender has enough tokens in balance before transferring or redeeming them
        require(ABDKMathQuad.cmp(balances[sender],ABDKMathQuad.fromUInt(tokens))!=-1);
        //check if tokens are being transferred to this cash contract
        if(receiver == address(this)){
            //if token name is the same, this transfer has to be redeemed
            if(redeem(ABDKMathQuad.fromUInt(tokens), sender, "redeem", address(this)))
                return true;
            else
                return false;
        }
        //else request issue of cash tokens requested from receiver
        else if(factory.getType(receiver)=="ViaCash"){ 
            require(!lock);
            lock = true;
            //only issue if cash tokens are paid in, since bond tokens can't be paid to issue bond token
            if(Cash(address(uint160(receiver))).requestIssue(ABDKMathQuad.fromUInt(tokens), sender, cashtokenName)){
                lock = false; 
                return true;                
            }
            else{
                lock = false;
                return false;
            }
        }
        //else if cash tokens are paid into bond issuers, then request for issue of bonds
        else if(factory.getType(receiver)=="ViaBond"){
            if(ViaBond(address(uint160(receiver))).requestIssue(ABDKMathQuad.fromUInt(tokens), sender, cashtokenName, address(this)))
                    return true;
                else
                    return false;
        }
        //else check if cash tokens are paid into any specific bond token for purchase
        else if(factory.getType(receiver)=="ViaBondToken"){
            if(ViaToken(address(uint160(receiver))).requestTransaction(ABDKMathQuad.fromUInt(tokens), sender, cashtokenName, address(this)))
                    return true;
                else
                    return false;
        }
        else{
            //else, tokens are being sent to another user's account
            //sending contract should be allowed by token owner to make this transfer
            if(redeem(ABDKMathQuad.fromUInt(tokens), sender, "transfer", receiver))
                return true;
            else
                return false;
        } 
    }

    //accessor for addToBalance function
    function requestAddToBalance(bytes16 tokens, address sender) external returns (bool){
        require(factory.getType(msg.sender) == "ViaCash" || factory.getType(msg.sender) == "ViaBond");
        return(addToBalance(tokens, sender));
    }

    //add to token balance of this contract from token balance of sender
    function addToBalance(bytes16 tokens, address sender) private returns (bool){
        //sender should have more tokens than being transferred
        if(ABDKMathQuad.cmp(tokens, balances[sender])==-1 || ABDKMathQuad.cmp(tokens, balances[sender])==0){
            balances[sender] = ABDKMathQuad.sub(balances[sender], tokens);
            balances[address(this)] = ABDKMathQuad.add(balances[address(this)], tokens);
            return true;
        }
        else
            return false;
    }

    //accessor for deductFromBalance function
    function requestDeductFromBalance(bytes16 tokens, address receiver) external returns (bytes16){
        require(factory.getType(msg.sender) == "ViaCash" || factory.getType(msg.sender) == "ViaBond");
        return(deductFromBalance(tokens, receiver));
    }

    //deduct token balance from this contract and add token balance to receiver
    function deductFromBalance(bytes16 tokens, address receiver) private returns (bytes16){
        //this cash token issuer should have more tokens than being deducted
        if(ABDKMathQuad.cmp(tokens, balances[address(this)])==-1 || ABDKMathQuad.cmp(tokens, balances[address(this)])==0){
            balances[address(this)] = ABDKMathQuad.sub(balances[address(this)], tokens);
            balances[receiver] = ABDKMathQuad.add(balances[receiver], tokens);
            return ABDKMathQuad.fromUInt(0);
        }
        else{
            bytes16 balance = ABDKMathQuad.sub(tokens, balances[address(this)]);
            balances[receiver] = ABDKMathQuad.add(balances[receiver], balances[address(this)]);
            balances[address(this)] = 0;            
            return balance;
        }
    }

    //handles fiat pay in for issue of cash tokens
    //sender is authorized by verified
    function payIn(uint256 tokens, address payer, bytes32 currency) external returns(bool){
        address client = factory.getClient();
        //require(VerifiedClient(client).getRole(msg.sender)=="Custodian");
        //contract must not be paused
        require(paused == false);
        if(issue(ABDKMathQuad.fromUInt(tokens), msg.sender, payer, currency))
            return true;
        else
            return false;
    }

    //accessor for issue function
    function requestIssue(bytes16 amount, address buyer, bytes32 currency) public returns(bool){
        require(factory.getType(msg.sender) == "ViaCash");
        return(issue(amount, address(this), buyer, currency));
    }

    //requesting issue of Via to buyer for amount of ether or some other via cash token paid in and stored in cashContract
    function issue(bytes16 amount, address depositor, address buyer, bytes32 currency) private returns(bool){
        //ensure that brought amount is not zero
        require(amount != 0);
        //find amount of via cash tokens to transfer after applying exchange rate
        if(currency=="ether"){
            //if ether is paid in for issue of Via-USD cash token, then all we need is the exchange rate of ether to USD (ethusd)
            //since the exchange rate of USD to Via-USD is always 1
            if(cashtokenName=="VXUSD"){
                bytes32 EthXid = oracle.request("eth","ethusd","EthCash", address(this)); 
                //bytes32 EthXid = "11";
                conversion storage c = conversionQ[EthXid];
                c.party = buyer;
                c.counterparty = depositor;
                c.operation = "issue";
                c.paid_in_currency = currency;
                c.payout_currency = cashtokenName;
                c.amount = amount;
                c.EthXvalue = ABDKMathQuad.fromUInt(0);
                c.ViaXvalue = ABDKMathQuad.fromUInt(1);
                //convert("11",ABDKMathQuad.fromUInt("451.25".stringToUint()),"ethusd");
            }
            //if ether is paid in for issue of non-USD cash token, we need the exchange rate of ether to the USD (ethusd)
            //and the exchange rate of Via-USD to the requested non-USD cash token (eg, Via-EUR)
            else{
                bytes32 EthXid = oracle.request("eth","ethusd","EthCash", address(this)); 
                bytes32 ViaXid = oracle.request(abi.encodePacked("VXUSD_to_", cashtokenName),"ver","Cash", address(this)); 
                oracle.setCallbackId(EthXid,ViaXid);
                //bytes32 EthXid = "11";
                //bytes32 ViaXid = "22";
                conversion storage c = conversionQ[ViaXid];
                c.party = buyer;
                c.counterparty = depositor;
                c.operation = "issue";
                c.paid_in_currency = currency;
                c.payout_currency = cashtokenName;
                c.amount = amount;
                c.EthXvalue = ABDKMathQuad.fromUInt(0);
                c.ViaXvalue = ABDKMathQuad.fromUInt(0);
                //convert("22",ABDKMathQuad.fromUInt("451.25".stringToUint()),"ethusd");
                //convert("22",ABDKMathQuad.fromUInt("1.2".stringToUint()),"ver");                
            }
        }
        //if ether is not paid in and instead, some other Via cash token is paid in
        //we need to find the exchange rate between the paid in Via cash token and the cash token this cash contract represents
        else{
            if(currency.substringinbytes(0,5)!=cashtokenName){
                bytes32 ViaXid = oracle.request(abi.encodePacked(currency.substring(0,5),"_to_",cashtokenName),"er","Cash", address(this)); 
                //bytes32 ViaXid = "33";
                conversion storage c = conversionQ[ViaXid];
                c.party = buyer;
                c.counterparty = depositor;
                c.operation = "issue";
                c.paid_in_currency = currency;
                c.payout_currency = cashtokenName;
                c.amount = amount;
                c.EthXvalue = ABDKMathQuad.fromUInt(0);
                c.ViaXvalue = ABDKMathQuad.fromUInt(0);
                //convert("33",ABDKMathQuad.fromUInt("7.6".stringToUint()),"er");
            }
            else{
                finallyIssue(amount, buyer, depositor, currency, amount);
            }
        }
        return true;
    }

    //requesting redemption of Via cash token and transfer of currency it was issued against
    //operation parameter indicates whether it is a redemption or a transfer of deposits from one party to another
    function redeem(bytes16 amount, address party, bytes32 operation, address receiver) private returns(bool){
        bool found = false;
        for(uint i=0; i<currencies.length && ABDKMathQuad.toUInt(amount)>0; i++){            
            //check if currency in which redemption is to be done has sufficient issued balance for the deposited currency
            if(ABDKMathQuad.cmp(deposits[party][currencies[i]].issuedAmount, amount)!=-1){
                bytes16 value = ABDKMathQuad.mul(ABDKMathQuad.div(amount, deposits[party][currencies[i]].issuedAmount),deposits[party][currencies[i]].depositAmount);
                deposits[party][currencies[i]].depositAmount = ABDKMathQuad.sub(deposits[party][currencies[i]].depositAmount, value);
                //reduces balances
                balances[party] = ABDKMathQuad.sub(balances[party], amount);
                deposits[party][currencies[i]].issuedAmount = ABDKMathQuad.sub(deposits[party][currencies[i]].issuedAmount, amount);
                require(!lock);
                lock = true;
                if(operation=="redeem"){
                    //adjust total supply
                    totalSupply_ = ABDKMathQuad.sub(totalSupply_, amount);
                    //check if any fee is payable on redemption and pay it if that is the case
                    value = payRedemptionFee(value);
                    //send redeemed ether to party
                    if(currencies[i]=="ether"){
                        address(uint160(party)).transfer(ABDKMathQuad.toUInt(value));
                    }
                    else{
                        //if(cashtokenName.substringinbytes(2,5)==currencies[i]){
                        if(deposits[party][currencies[i]].depositor!=address(this)){
                            //if currency to redeem is fiat counterpart of this cash token, request oracle to pay out fiat
                            oracle.payOut(deposits[party][currencies[i]].depositor, party, currencies[i], ABDKMathQuad.toUInt(value));
                        }
                        else{
                            address cashToken = factory.getTokenByNameType(currencies[i],"ViaCash");
                            Cash(address(uint160(cashToken))).requestDeductFromBalance(value, party);
                        }
                    }
                    //generate event
                    emit CashRedeemed(party, currencies[i], ABDKMathQuad.toUInt(value));
                }
                else if(operation=="transfer"){
                    //check if any fee is payable on remittance and acceptance and pay it if that is the case
                    (amount, value) = payTransferFee(amount, value, currencies[i]);
                    //transfer balances
                    balances[receiver] = ABDKMathQuad.add(balances[receiver], amount);
                    //transfer deposits
                    deposits[receiver][currencies[i]].depositAmount = ABDKMathQuad.add(deposits[receiver][currencies[i]].depositAmount, value);
                    //transfer issued amounts
                    deposits[receiver][currencies[i]].issuedAmount = ABDKMathQuad.add(deposits[receiver][currencies[i]].issuedAmount, amount);                    
                    emit CashTransfer(address(this), receiver, currencies[i], ABDKMathQuad.toUInt(amount));
                }
                amount = 0;
                found = true;
                lock = false;
            }
            //amount to redeem is more than what is in deposit, so we need to remove deposit after redemption
            else{
                //reduces balances
                balances[party] = ABDKMathQuad.sub(balances[party], deposits[party][currencies[i]].issuedAmount);
                require(!lock);
                lock = true;
                if(operation=="redeem"){
                    //adjust total supply
                    totalSupply_ = ABDKMathQuad.sub(totalSupply_, deposits[party][currencies[i]].issuedAmount);
                    //check if any fee is payable on redemption and pay it if that is the case
                    bytes16 value = payRedemptionFee(deposits[party][currencies[i]].depositAmount);
                    //send redeemed ether to party which is all of the ether in deposit with this user (party)
                    if(currencies[i]=="ether"){    
                        address(uint160(party)).transfer(ABDKMathQuad.toUInt(value));
                    }
                    else{
                        //if(cashtokenName.substringinbytes(2,5)==currencies[i]){
                        if(deposits[party][currencies[i]].depositor!=address(this)){
                            //if currency to redeem is fiat counterpart of this cash token, request oracle to pay out fiat
                            oracle.payOut(deposits[party][currencies[i]].depositor, party, currencies[i], ABDKMathQuad.toUInt(value));
                        }
                        else{
                            address cashToken = factory.getTokenByNameType(currencies[i],"ViaCash");
                            Cash(address(uint160(cashToken))).requestDeductFromBalance(value, party);
                        }
                    }                    
                    //generate event
                    emit CashRedeemed(party, currencies[i], ABDKMathQuad.toUInt(value));
                }
                else if(operation=="transfer"){
                    //check if any fee is payable on remittance and acceptance and pay it if that is the case
                    (bytes16 amtSend, bytes16 value) = payTransferFee(deposits[party][currencies[i]].issuedAmount, deposits[party][currencies[i]].depositAmount, currencies[i]);
                    //transfer balances
                    balances[receiver] = ABDKMathQuad.add(balances[receiver], amtSend);
                    //transfer deposits
                    deposits[receiver][currencies[i]].depositAmount = ABDKMathQuad.add(deposits[receiver][currencies[i]].depositAmount, value);
                    //transfer issued amounts
                    deposits[receiver][currencies[i]].issuedAmount = ABDKMathQuad.add(deposits[receiver][currencies[i]].issuedAmount, amtSend);
                    emit CashTransfer(address(this), receiver, currencies[i], ABDKMathQuad.toUInt(amtSend));
                }
                //calculate remaining amount to redeem or transfer
                amount = ABDKMathQuad.sub(amount, deposits[party][currencies[i]].issuedAmount);
                //make deposit and issued amount balances zero for ether
                delete deposits[party][currencies[i]];
                found = true;
                lock = false;
            }
        }
        return found;
    }    

    //function called back from Via oracle
    function convert(bytes32 txId, bytes16 result, bytes32 rtype) external {
        require(oracle == ViaOracle(msg.sender));
        //check type of result returned
        if(rtype =="ethusd"){
            conversionQ[txId].EthXvalue = result;
        }
        if(rtype == "er"){
            conversionQ[txId].ViaXvalue = result;
        }
        if(rtype == "ver"){
            conversionQ[txId].ViaXvalue = result;
        }
        if(conversionQ[txId].operation=="issue"){
            if(rtype == "ethusd" || rtype == "ver"){
                //for issuing to happen when ether is paid in,
                //value of ethX (ie ether exchange rate to USD) has to be non-zero 
                //and viaX (ie via exchange) should be non-zero if cash token to be issued is not Via-USD. We store 1 for ViaXvalue if Via-USD has to be issued
                if(ABDKMathQuad.cmp(conversionQ[txId].EthXvalue, ABDKMathQuad.fromUInt(0))!=0 && ABDKMathQuad.cmp(conversionQ[txId].ViaXvalue, ABDKMathQuad.fromUInt(0))!=0){
                    bytes16 via = paymentutils.convertToVia(cashtokenName, conversionQ[txId].amount, conversionQ[txId].paid_in_currency,conversionQ[txId].EthXvalue,conversionQ[txId].ViaXvalue);
                    finallyIssue(via, conversionQ[txId].party, conversionQ[txId].counterparty, conversionQ[txId].paid_in_currency, conversionQ[txId].amount);
                    delete conversionQ[txId];
                }
            }
            else if(rtype == "er"){
                //for issuing to happen if some other Via cash token is paid in, 
                //only the value of ViaX (ie exchange rate of paid in Via cash token to Via cash token to issue) has to be non-zero
                if(ABDKMathQuad.cmp(conversionQ[txId].ViaXvalue, ABDKMathQuad.fromUInt(0))!=0){
                    bytes16 via = paymentutils.convertToVia(cashtokenName, conversionQ[txId].amount, conversionQ[txId].paid_in_currency,conversionQ[txId].EthXvalue,conversionQ[txId].ViaXvalue);
                    finallyIssue(via, conversionQ[txId].party, conversionQ[txId].counterparty, conversionQ[txId].paid_in_currency, conversionQ[txId].amount);
                    delete conversionQ[txId];
                }
            }
        }
    }

    //via is the number of this via cash token that is being issued, 
    //party is the user account address to which issued tokens are credited
    function finallyIssue(bytes16 via, address party, address counterparty, bytes32 currency, bytes16 amount) private {
        bool status = true;
        if(currency!="ether"){
            address cashToken = factory.getTokenByNameType(currency,"ViaCash");
            //transfer amount of currency from party to the deposit currency's cash contract 
            if(counterparty==address(this))
                status = Cash(address(uint160(cashToken))).requestAddToBalance(amount, party);
            else
                status = addToBalance(amount, counterparty);
        }
        if(status){
            bytes16 margin = rates.getMargin(currency);
            //calculate cash token amount to issue
            bytes16 toIssue = ABDKMathQuad.mul(ABDKMathQuad.sub(ABDKMathQuad.fromUInt(1),margin),via);
            //add paid in currency to depositor
            if(ABDKMathQuad.toUInt(deposits[party][currency].depositAmount)==0 && ABDKMathQuad.toUInt(deposits[party][currency].issuedAmount)==0){
                deposits[party][currency].depositAmount = amount;
                deposits[party][currency].issuedAmount = toIssue;
                deposits[party][currency].depositor = counterparty;
                currencies.push(currency);
            }
            else{
                deposits[party][currency].depositAmount = ABDKMathQuad.add(deposits[party][currency].depositAmount, amount);
                deposits[party][currency].issuedAmount = ABDKMathQuad.add(deposits[party][currency].issuedAmount, toIssue);
                deposits[party][currency].depositor = counterparty;
            }
            emit CashDeposits(party, currency, ABDKMathQuad.toUInt(deposits[party][currency].depositAmount));
            //add via to this contract's balance first (ie issue them first)
            balances[address(this)] = ABDKMathQuad.add(balances[address(this)], toIssue);
            //transfer amount to buyer 
            transfer(party, ABDKMathQuad.toUInt(toIssue));
            //adjust total supply
            totalSupply_ = ABDKMathQuad.add(totalSupply_, toIssue);
            //generate event        
            emit CashIssued(party, cashtokenName, ABDKMathQuad.toUInt(toIssue));
        }
    }
    
    function payTransferFee(bytes16 amount, bytes16 value, bytes32 currency) private returns (bytes16, bytes16){
        bytes16 fees = rates.getFee("remittance");
        if(ABDKMathQuad.cmp(fees,0)==1){
            address feeTo = rates.getFeeToSetter();
            if(feeTo!=address(0x0)){
                balances[feeTo] = ABDKMathQuad.add(balances[feeTo], ABDKMathQuad.mul(fees, amount));
                amount = ABDKMathQuad.sub(amount, ABDKMathQuad.mul(fees, amount));
                deposits[feeTo][currency].depositAmount = ABDKMathQuad.add(deposits[feeTo][currency].depositAmount, ABDKMathQuad.mul(fees, value)); 
                value = ABDKMathQuad.sub(value, ABDKMathQuad.mul(fees, value));
            }
        }
        return (amount, value);
    }

    function payRedemptionFee(bytes16 value) private returns (bytes16){
        bytes16 fees = rates.getFee("redemption");
        bytes16 returnValue = value;
        if(ABDKMathQuad.cmp(fees,0)==1){
            address feeTo = rates.getFeeToSetter();
            if(feeTo!=address(0x0)){
                address(uint160(feeTo)).transfer(ABDKMathQuad.toUInt(ABDKMathQuad.mul(fees, value)));
                returnValue = ABDKMathQuad.sub(value, ABDKMathQuad.mul(fees, value));
            }
        }
        return returnValue;
    }

    //check AML status for account address
    function amlCheck(address account) private view returns(bool){
        address client = factory.getClient();
        if(client==address(0x0))
            return true;
        if(VerifiedClient(client).getAMLStatus(account))
            return true;
        else
            return false;
    }

    function pause() public {
        require(msg.sender == owner() || msg.sender == address(factory));
        _pause();
    }
    function unpause() public {
        require(msg.sender == owner() || msg.sender == address(factory));
        _unpause();
    }

}
